import React from 'react';
import {StyleSheet, Text, View, ScrollView, Image, TouchableWithoutFeedback} from 'react-native';
import { restaurants } from '../App';
import restauranteCart from './RestauranteCart'
export default  function Home({navigation}) {
    return (
        <View style={{flex: 1, padding: 20, borderTopWidth: 20, borderTopColor:'purple'}}>
          <ScrollView style={styles.container}>{
            Object.keys(restaurants).map(restaurante => {
                return(
                    <TouchableWithoutFeedback  key={restaurants[restaurante].id}  onPress={() => navigation.push('restaurants', {user : restaurante})}>
                      <View style={{flexDirection: 'row', backgroundColor: 'ghostwhite'}}>
                      <Image source={restaurants[restaurante].image} style={styles.image}/> 
                      <View style={{flex : 1, flexDirection : 'column', justifyContent : 'flex-start', alignItems:'center'}}>
                        <Text style={styles.username}>{restaurante}</Text>
                        <Text style={styles.bio}>{restaurants[restaurante].PricePoint}{restaurants[restaurante].Tags.map(tag => " ⸎ " + tag)}</Text>
                      </View>
                      </View>
                    </TouchableWithoutFeedback>
                )
              })
          }</ScrollView>
        </View>
    );
}


const styles = StyleSheet.create({
    container: {
      textAlign: 'left',
      backgroundColor: 'white',
      paddingBottom: 10,
    },
    username: {
      fontSize:  15,
      fontWeight: 'bold',
      textAlign: 'center',
    },
    bio : {
      fontSize: 10,
      padding: 5,
      textAlign: 'left',
      justifyContent:'flex-start',
    },
    image: {
        width: 150,
        height: 100,
    }
  });
